CREATE TABLE tbl_localidades_postal (
  id NUMBER(5) PRIMARY KEY,
  id_provincia NUMBER(5) NOT NULL,
  nombre VARCHAR2(150) NOT NULL,
  codigopostal NUMBER(5) NOT NULL,
  FOREIGN KEY(id_provincia) references tbl_provincias_postal(id)
);

